import React from 'react';

function SingleSignOn() {
    const openModal = () => {
        document.getElementById("videoModal").style.display = "flex";
    };

    const closeModal = () => {
        document.getElementById("videoModal").style.display = "none";
    };

    return (
        <div>
            <div className="main-sso">
                <div className="sso-authentication">
                    <div className="content-left">
                        <h1 className="title">Single Sign-On (SSO)</h1>
                        <p className="description">
                            Simplify your user experience with seamless SSO, enabling users to access multiple applications with a single login, boosting security, and reducing login fatigue.
                        </p>
                        <div className="button-group">
                            <button className="custom-button">Learn More About SSO</button>
                            <button className="custom-button">Contact Our Team</button>
                            <button className="custom-button" onClick={openModal}>Watch Demo</button>
                        </div>
                    </div>

                    <div className="content-right">
                        <img src="https://example.com/sso-image.png" alt="SSO Illustration" className="sso-image" />
                    </div>
                </div>
            </div>

            {/* Modal for Demo Video */}
            <div id="videoModal" className="modal">
                <div className="modal-content">
                    <span className="close" onClick={closeModal}>&times;</span>
                    <iframe
                        src="https://app.goconsensus.com/api/mps/media/e24d34c5-0d86-4d20-a09e-032a01de43d6"
                        width="100%"
                        height="400"
                        frameBorder="0"
                        allow="autoplay; fullscreen"
                    ></iframe>
                </div>
            </div>
        </div>
    );
}

export default SingleSignOn;
